import React from 'react';
import DropdownMenu from './components/DropdownMenu';
import AssetForm from './components/AssetForm';
import AssetListPanel from './components/AssetListPanel';
import './styles/App.css';

const App = () => {
  return (
    <div className="background">
      <div className="overlay">
        <DropdownMenu />
        <div className="form-container">
          <AssetForm />
          <button className="save-button">Save Asset</button>
          <button className="generate-report-button">Generate Report</button>
          <button className="add-asset-button">Add Asset</button>
          <button className="same-as-previous-button">Same As Previous</button>
        </div>
        <AssetListPanel />
      </div>
    </div>
  );
};

export default App;
